import axios from 'axios';

const url = "http://localhost:5005/product/";

export const fetchPosts = () => axios.get(url);
export const createPost = (newpost) => axios.post(url,newpost);


export default {
    getData: () =>
    axios({
        'method':'GET',
        'url':'https://localhost:5005/product'
        })
}
